import React from "react";
import * as path from 'app-root-path/index';


const { PROJECT_ROOT} = path;


const Navbar = () => {
    const LOGO = String.concat(PROJECT_ROOT, "./src/static/National-Geographic-Logo.svg")
    return (
        <>
        <span>{LOGO}</span>
        </>
    )
}

export  default Navbar;
